import React, {Component} from 'react';
import {BrowserRouter} from "react-router-dom";
import Home from '/Home';

class App extends Component {
    render() {
        return (
            <BrowserRouter>
                <div className="App">
                    Test
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
